import { NavLink } from "react-router-dom"

function Section({title,more = false}){
    return(
        <Section>
            <header className="flex istems-center justify-between">
                <h3 className="text2xl text-white font-semibold tracking-light">{title}</h3>
               {more && (
                  <NavLink className={"text-sm font uppercase"} to={more}>
                   SEE ALL
                  </NavLink>
               
               )}
            </header>
        </Section>
    )
}

export default Section
